// Products.jsx
import React, { useState, useEffect, useContext } from "react";
import mensWearData from './mens.json';
import womensWearData from './womens.json';
import newarrivals from './newarrivals.json';
import './Products.css';import { useCart } from '../Cart/CartContext.jsx';  // Ensure correct path


const ProductCard = ({ product, onAddToCart, onAddToWishlist, isInWishlist }) => {
  return (
    <div className="card" style={{ width: "18rem", margin: "10px" }}>
      <img src={product.imageUrl} className="card-img-top" alt={product.name} height={300} width={300} />
      <div className="card-body">
        <h5 className="card-title">{product.name}</h5>
        <p className="card-text">Price: â‚¹{product.price}</p>
        <div className="card-actions">
          <button onClick={() => onAddToCart(product)} className="btn btn-dark">
            <i className="fas fa-shopping-cart"></i> Add to Cart
          </button>
          <button
            onClick={() => onAddToWishlist(product)}
            className={`btn ${isInWishlist ? 'btn-danger' : 'btn-light'}`}
          >
            <i className="fas fa-heart"></i> {isInWishlist ? 'Remove from Wishlist' : 'Add to Wishlist'}
          </button>
        </div>
      </div>
    </div>
  );
};

const MensWearPage = ({ category }) => {
  const [data, setData] = useState([]);
  const [selectedCategory, setSelectedCategory] = useState('All');
  const [sortOrder, setSortOrder] = useState(null);
  const { addToCart, addToWishlist, isProductInWishlist } = useContext(CartContext);

  useEffect(() => {
    switch (category) {
      case "mens":
        setData(mensWearData.mensWear);
        break;
      case "womens":
        setData(womensWearData.womensWear);
        break;
      case "newArrivals":
        setData(newarrivals.newArrivals);
        break;
      default:
        setData([]);
    }
  }, [category]);

  const filteredItems = selectedCategory === 'All'
    ? data.flatMap(cat => cat.items || [])
    : data.filter(cat => cat.category === selectedCategory).flatMap(cat => cat.items || []);

  const sortedItems = [...filteredItems].sort((a, b) => {
    if (sortOrder === 'asc') return a.price - b.price;
    if (sortOrder === 'desc') return b.price - a.price;
    return 0;
  });

  const handleAddToCart = (product) => {
    addToCart(product);
  };

  const handleAddToWishlist = (product) => {
    if (isProductInWishlist(product.id)) {
      // Remove from wishlist if already in it
      removeFromWishlist(product.id);
    } else {
      // Add to wishlist
      addToWishlist(product);
    }
  };

  return (
    <div className="container">
      <div className="category-buttons">
        <button onClick={() => setSelectedCategory('All')}>All</button>
        {data.map(cat => (
          <button key={cat.id} onClick={() => setSelectedCategory(cat.category)}>
            {cat.category}
          </button>
        ))}
      </div>

      <div className="sort-container">
        <button onClick={() => setSortOrder(sortOrder === 'asc' ? 'desc' : 'asc')}>
          Sort by Price ({sortOrder === 'asc' ? 'Lowest to Highest' : 'Highest to Lowest'})
        </button>
      </div>

      <div className="products">
        {sortedItems.length === 0 ? (
          <p>No products available in this category</p>
        ) : (
          sortedItems.map(product => (
            <ProductCard
              key={product.id}
              product={product}
              onAddToCart={handleAddToCart}
              onAddToWishlist={handleAddToWishlist}
              isInWishlist={isProductInWishlist(product.id)}
            />
          ))
        )}
      </div>
    </div>
  );
};

export default MensWearPage;
